import React from 'react'

export default function Pagination(props) {
    const pageNumbers = []

    for (let i = 1; i <= Math.ceil(props.totalPosts / props.postsPerPage); i++) {
        pageNumbers.push(i)
    }

    return (
        <div>

            <ul >
                {pageNumbers.map(number => (
                    <li key={number} >
                        <a  href='!#' >
                            {number}
                        </a>
                    </li>
                ))}
            </ul>

        </div>
    )
}
